import React from 'react';

const VideoItem = ({thumb, title, published}) => {
    return (
        <div className='button p-10 m-1 r-10 bg-black color-yellow'>
            <img alt={title} src={thumb} />
            <div className='small bold'>{title}</div>
            <div className='copyright'>{published.substring(0,9)}</div>
        </div>
    ) 
};

export default VideoItem;
